INSERT INTO `tbl_surat` (`id`, `nomor`, `lampiran`, `hal`, `tgl_pkl`, `p1`, `p2`, `p3`, `p4`, `p5`, `p6`, `tgl_surat`, `kepala_sekolah`, `nbm`) VALUES
(1, '<?= $nomor[\'nomor\']; ?>', '2 Lembar', '    Permohonan Izin PKL', ' 03 Januari s/d 31 Maret 2022', 'Dengan hormat, berkaitan dengan program kegiatan Praktik Kerja Lapangan yang akan dilakukan oleh siswa SMK Muhammadiyah Karangmojo, kami mohon izin untuk melakukan Praktik Kerja Lapangan di instansi / dunia usaha / dunia industri / dunia kerja (IDUKA) yang Bapak/Ibu pimpin. Kegiatan tersebut dilakukan selama 3 (tiga) bulan, yakni mulai tanggal :', 'Sebagai alat konfirmasi, bersama surat ini kami lampirkan lembar pernyataan kesanggupan. Mohon berkenan mengisi dan diserahkan kepada kami melalui peserta PKL.', 'Demikian surat ini kami kirimkan atas perhatian dan kerjasama Bapak/Ibu disampaikan terima kasih.', 'Memperhatikan surat permohonan izin PKL dari SMK Muhammadiyah Karangmojo Nomor : <?= $nomor[\'nomor\']; ?>, maka kami menyatakan :', 'Menampung siswa Praktik Kerja Lapangan dari SMK Muhammadiyah Karangmojo, dengan durasi waktu mulai tanggal : 03 Januari 2022 s/d 31 Maret 2022 dengan daftar peserta PKL yang kami setujui sebagai berikut :', 'Demikian surat pernyataan ini kami buat, agar dapat dipergunakan sebagaimana mestinya.', 'Karangmojo, 11 November 2020', 'Munawar, S.Pd.I', '1 076 230');
